import {Link } from "react-router-dom"
interface WarningHeader{
    label:string,
     buttonText:string,
     to: string;

}
export const BottomWarning: React.FC<WarningHeader> = ({ label, buttonText, to }) => {
    return (
      <div className="text-xs font-medium flex justify-center pt-5">
        <div>{label}</div>
        <Link className="text-xs font-medium pointer underline pl-1 cursor-pointer text-blue-600" to={to}>
          {buttonText}
        </Link>
      </div>
    );
  };
